    false,nt"url": null,nt"notes": "n               Metropolitan and Micropolitan
    Statistical Areas are together termed Core Based Statistical Areas (CBSAs) and are
    defined by the Office of Managementn               and Budget(OMB) and consist of
    the county or counties or equivalent entities associated with at least one urban
    core (urbanized area or urban cluster)n               of at least 10,000 population,
    plus adjacent counties having a high degree of social and economic integration with
    the core as measured throughn               commuting ties with the counties containing
    the core. Categories of CBSAs are: Metropolitan Statistical Areas, based on urbanized
    areas of 50,000 orn               more population; and Micropolitan Statistical
    Areas, based on urban clusters of at least 10,000 population but less than 50,000
    population. The CBSAsn               boundaries are those defined by OMB based on
    the 2010 Census and published in 2013.n            ",nt"license_title": null,nt"extras":
